import './Back.css';
import ReturnIMG from './IMG';
import ReturnQuOte from './Quote';
import ReturnBlAck from './Black';

import Media from 'react-media';

// Return Back 
export default function ReturnBAck() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

const ScreenLarge = () => (
 <div className='wrp-black-cover'>
  <ViewText />
 </div>
)
const ScreenSmall = () => (
 <div className='wrp-black-cover-sm'>
  <ViewText />
 </div>
)


export const ViewText = () => (
 <>
  <ReturnBlAck />
  <ReturnIMG />
  <ReturnQuOte />
 </>
);
